import React from "react";
import second from './int'
function Intro() {
  return (
    <>
      <div className="intro">
        <div className="i-left">
          <div className="i-name">
            <span>Hey! I am</span>
            <span>D K Patel</span>
            <span>
              React js Developer with high level of experience in web
              development
            </span>
          </div>
          <button className="button i-button"> Hire Me</button>
        </div>
        <div className="i-right">Hello I am right side</div>
      </div>
    </>
  );
}

export default Intro;
